Editor.prototype.readTimer = function() {
    var written_words, press = 'no_press';
    $.extend({
        APP: {
            formatTimer: function(a) {
                if (a < 10) {
                    a = '0' + a;
                }
                return a;
            },
            startTimer: function(dir) {
                if (press == 'reset' || press == 'no_press')
                    written_words = parseInt($('#word_count').html());
                var a;
                $.APP.dir = dir;
                $.APP.d1 = new Date();
                switch ($.APP.state) {
                    case 'pause':
                        $.APP.t1 = $.APP.d1.getTime() - $.APP.td;
                        break;
                    default:
                        $.APP.t1 = $.APP.d1.getTime();
                        if ($.APP.dir === 'cd') {
                            $.APP.t1 += parseInt($('#cd_seconds').val()) * 1000;
                        }
                        break;
                }
                $.APP.state = 'alive';
                $('#' + $.APP.dir + '_status').html('Running');
                $.APP.loopTimer();
            },
            pauseTimer: function() {
                press = 'pause';
                $.APP.dp = new Date();
                $.APP.tp = $.APP.dp.getTime();
                $.APP.td = $.APP.tp - $.APP.t1;
                $.APP.state = 'pause';
            },
            stopTimer: function() {
                $.APP.state = 'stop';
            },
            resetTimer: function() {
                press = 'reset';
                $('#' + $.APP.dir + '_ms,#' + $.APP.dir + '_s,#' + $.APP.dir + '_m,#' + $.APP.dir + '_h').html('00');
                $('#' + $.APP.dir + '_ms1,#' + $.APP.dir + '_s1,#' + $.APP.dir + '_m1,#' + $.APP.dir + '_h1').html('00');
                $.APP.state = 'reset';
            },
            endTimer: function(callback) {
                $.APP.state = 'end';
                if (typeof callback === 'function') {
                    callback();
                }
            },
            loopTimer: function() {
                var td;
                var d2, t2;
                var ms = 0;
                var s = 0;
                var m = 0;
                var h = 0;
                var just_written_words;
                if ($.APP.state === 'alive') {
                    d2 = new Date();
                    t2 = d2.getTime();
                    if ($.APP.dir === 'sw') {
                        td = t2 - $.APP.t1;
                    } else {
                        td = $.APP.t1 - t2;
                        if (td <= 0) {
                            $.APP.endTimer(function() {
                                $.APP.resetTimer();
                            });
                        }
                    }
                    ms = td % 1000;
                    if (ms < 1) {
                        ms = 0;
                    } else {
                        just_written_words = parseInt($('#word_count').html()) - written_words;
                        if (just_written_words < 0) {
                            just_written_words = 0;
                            written_words--;
                        }
                        $('#wpm, #wpm1').html((just_written_words / (td / 1000 / 60)).toFixed(0));
                        s = (td - ms) / 1000;
                        if (s < 1) {
                            s = 0;
                        } else {
                            var m = (s - (s % 60)) / 60;
                            if (m < 1) {
                                m = 0;
                            } else {
                                var h = (m - (m % 60)) / 60;
                                if (h < 1) {
                                    h = 0;
                                }
                            }
                        }
                    }
                    ms = Math.round(ms / 100);
                    s = s - (m * 60);
                    m = m - (h * 60);
                    $('#' + $.APP.dir + '_ms, #' + $.APP.dir + '_ms1').html($.APP.formatTimer(ms));
                    $('#' + $.APP.dir + '_s, #' + $.APP.dir + '_s1').html($.APP.formatTimer(s));
                    $('#' + $.APP.dir + '_m, #' + $.APP.dir + '_m1').html($.APP.formatTimer(m));
                    $('#' + $.APP.dir + '_h, #' + $.APP.dir + '_h1').html($.APP.formatTimer(h));
                    $.APP.t = setTimeout($.APP.loopTimer, 100);
                } else {
                    clearTimeout($.APP.t);
                    return true;
                }
            }
        }
    });
};
